def main(filename, start=None, **kwargs):
    if start is None:
        start = 'start'
    if not filename or filename == '-':
        text = sys.stdin.read()
    else:
        with open(filename) as f:
            text = f.read()
    parser = ThyParser()
    return parser.parse(text, rule_name=start, filename=filename, **kwargs)


